export default function About() {
return (
    <div>
      {/* Aquí puedes tener un Navbar o cualquier otra sección */}

      {/* Sección Carrousel en lugar de About */}
      <section id="about">
        <h2 className="text-4xl text-center mb-8">Mis Proyectos</h2>
        <ImageCarousel />
      </section>

      {/* Puedes agregar otras secciones debajo, como proyectos, contacto, etc. */}
      <section id="projects" className="my-12">
        <h2>Proyectos</h2>
        {/* Aquí van los proyectos */}
      </section>

      <section id="contact" className="my-12">
        <h2>Contacto</h2>
        {/* Aquí va el formulario de contacto o información */}
      </section>
    </div>
  );
}
